import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Button, View, LogBox } from 'react-native';

import LoginScreen from './App/Screens/LoginScreen';
import RegisterScreen from './App/Screens/RegisterScreen';
import MainScreen from './App/Screens/MainScreen';
import AppScreen from './App/Screens/AppScreen';
import SettingScreen from './App/Screens/SettingScreen';

import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { FontAwesome5 } from '@expo/vector-icons';

LogBox.ignoreLogs(['AsyncStorage has been extracted from react-native core']);

const Stack = createNativeStackNavigator();
const Tab = createBottomTabNavigator();

function MyTabs() {
  return (
    <Tab.Navigator>
      <Tab.Screen name="Main" component={MainScreen} options={{headerShown: false}}  />
      <Tab.Screen name="Setting" component={SettingScreen} options={{
        headerStyle: {
              backgroundColor: '#61dafb'
           },
           headerLeft: () => (
            <Button
              onPress={() => goBack()}
              title="<"
              color="#000"
            />
          ),
          }} />
    </Tab.Navigator>
  );
}

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator>
        <Stack.Screen name="MyTab" component={MyTabs}  />
        <Stack.Screen name="Main" component={MainScreen}  />
        <Stack.Screen name="App" component={AppScreen} options={{ title: 'Home' }} />
        <Stack.Screen name="Login" component={LoginScreen} options={{headerShown: false}} />
        <Stack.Screen name="Register" component={RegisterScreen} options={{headerShown: false}} />
        <Stack.Screen name="Setting" component={SettingScreen} options={{headerShown: false}} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
